import React,{ useState } from 'react'

const CreateNote = () => {

    const [note, setNote] = useState({
        title: '',
        content: '',
    })

    const inputEvent = (event) =>{

        

        setNote((preData) =>{
            return {
                ...preData,

            }
        })
    }

    return (
        <>
            <div className="main_note">
                <form action="">
                    <input 
                        type="text"
                        placeholder="Title"
                        autoComplete="off"
                        value={note.title}
                        onChange={inputEvent} />
                    <textarea
                        name=""
                        id=""
                        rows="4" 
                        value={note.title}
                        onChange={inputEvent}
                        placeholder="Write a note...">
                        </textarea>
                    <button className="btn btn-dark btn-sm add_btn">Add</button>
                </form>
            </div>
        </>
    )
}

export default CreateNote
